import './App.css';
//import Paginas from './components/Paginas';
import data from './db.json'
import {Link , BrowserRouter, Route, Routes} from 'react-router-dom'
import Paginas from './components/Paginas';

function App() {
  return (
    <BrowserRouter>
    <div>
      {data.map((empresa)=>{
        return (
          <Link to={empresa.cliente}>
            <button>
              {empresa.cliente}
            </button>
          </Link>
        )
      })}
      {/* <Paginas /> */}
    </div>
    <Routes>
      <Route path="/viamo" element={Paginas}></Route>
    </Routes>
    </BrowserRouter>
  );
}

export default App;
